INSERT INTO `gy_entries` VALUES (1,1,1,'東','春方也≆說文曰動也从日在木中亦東風菜廣州記云陸地生莖赤和肉作羹味如酪香似蘭吳都賦云莫則東風扶留又姓舜七友有東不訾又漢複姓十三氏左傳魯郷東門襄仲後因氏焉齊有大夫東郭偃又有東宫得臣晉有東關嬖五神仙傳有廣陵人東陵聖母適杜氏齊景公時有隱居東陵者乃以爲氏丗本宋大夫東郷爲[-/人]賈執英賢傳云今高密有東郷姓宋有貟外郎東陽無疑撰齊諧記七卷昔有東閭子甞富貴後乞於道云吾爲相六年未薦一士夏禹之後東樓公封于杞後以爲氏莊子東野稷漢有平原東方朔曹瞞傳有南陽太守東里昆何氏姓苑有東萊氏德紅切十七',22,1,''),(2,1,2,'菄','東風菜義見上注俗加艹',22,2,''),(3,1,3,'鶇','鶇鵍鳥名美形出廣雅亦作𪂝',22,3,''),(4,1,4,'䍶','獸名山海經曰秦戲山有獸狀如羊一角一目目在耳後其名曰䍶又音陳音棟',22,4,''),(5,1,5,'𠍀','儱倲儜劣皃出字諟',23,1,''),(6,1,6,'倲','上同',23,2,''),(7,1,7,'𩜍','地理志云東郡館名',23,3,''),(8,1,8,'𢘐','古文見道經',23,4,''),(9,1,9,'涷','瀧涷沾漬≆說文曰水出發鳩山入於河又都貢切',23,5,''),(10,1,10,'蝀','螮蝀虹也又音董',23,6,''),(11,1,11,'凍','凍凌又都貢切',23,7,''),(12,1,12,'鯟','魚名似鯉',23,8,''),(13,1,13,'𢔅','行皃',23,9,''),(14,1,14,'崠','崠如山名',23,10,''),(15,1,15,'埬','上埬地名',23,11,''),(16,1,16,'𧓕','蛞𧓕科斗蟲也案爾雅曰科斗活東郭璞云蝦蟆子也字俗從䖵',23,12,''),(17,1,17,'䰤','醜皃',23,13,''),(18,2,1,'同','齊也共也輩也合也律歷有六同亦州春秋時晉夷吾獻其西河地於秦七國時屬魏秦并天下爲內史之地漢武更名馮翊又有九龍泉泉有九源同爲一流因以名之又羌複姓有同蹄氏望在勃海徒紅切四十五',23,14,''),(19,2,2,'仝','古文出道書',23,15,''),(20,2,3,'童','童獨也言童子未有室家也又姓出東莞漢有琅邪內史童仲玉',23,16,''),(21,2,4,'僮','僮僕又頑也癡也又姓漢有交阯刺史僮尹出風俗通',23,17,''),(22,2,5,'銅','金之一品',23,18,''),(23,2,6,'桐','木名月令曰淸明之日桐始華又桐廬縣在睦州亦姓有桐君藥録兩卷',23,19,''),(24,2,7,'峒','崆峒山名',23,20,''),(25,2,8,'硐','磨也',23,21,''),(26,2,9,'𦨴','𦨴舩',23,22,''),(27,2,10,'𧱁','獸似豕出泰山',23,23,''),(28,2,11,'筒','竹筒又竹名射筒吳都賦曰其竹則桂箭射筒',23,24,''),(29,2,12,'瞳','目瞳',23,25,''),(30,2,13,'㼧','㼧瓦',23,26,''),(31,2,14,'𤭁','上同',23,27,''),(32,2,15,'罿','車上網又音衝',23,28,''),(33,2,16,'犝','犝牛無角',23,29,''),(34,2,17,'筩','竹筩',23,30,''),(35,2,18,'潼','水名出廣漢郡亦關名又通衝二音',23,31,''),(36,2,19,'曈','曈曨日欲明也又他孔切',23,32,''),(37,2,20,'洞','洪洞縣名在晉州北又徒弄切',23,33,''),(38,2,21,'侗','楊子法言云倥侗顓蒙',23,34,''),(39,2,22,'橦','木名花可爲布出字書又鍾幢二音',23,35,''),(40,2,23,'烔','熱氣烔烔出字林',23,36,''),(41,2,24,'䴀','鸏䴀水鳥黃喙喙長尺餘南人以爲酒器出劉欽期交州記',23,37,''),(42,2,25,'挏','引也漢官名有挏馬又音動',24,1,''),(43,2,26,'酮','馬酪又音動',24,2,''),(44,2,27,'鮦','爾雅云鰹大鮦又直冡直栁二切',24,3,''),(45,2,28,'㼿','井甓一云甃也',24,4,''),(46,2,29,'𦏆','無角羊',24,5,''),(47,2,30,'𦍻','上同',24,6,''),(48,2,31,'眮','目眶又徒揔切',24,7,''),(49,2,32,'蕫','草名又多動切',24,8,''),