DROP TABLE IF EXISTS `gy_finals`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gy_finals` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `hu` varchar(3) DEFAULT NULL COMMENT 'Either 開 or 合. From RhymeDict. This is a reconstructed field and cannot be predicted from either GY or YJ.',
  `deng` int(11) DEFAULT NULL COMMENT '1-4. Reconstructed value, not predictable from YJ table row.',
  `final_name` varchar(4) DEFAULT NULL COMMENT 'Names as used by the RhymeDict project, and ytenx.org.',
  `yj_page` int(11) NOT NULL COMMENT 'Ideally, the page (zhuan) of the YJ on which the final appears. However, some finals as used in this table appear in more than one table.',
  `yj_qu_as_ru` tinyint(1) NOT NULL COMMENT 'True if qusheng final placed in rusheng row',
  `chongniu` int(11) NOT NULL DEFAULT '0' COMMENT '3 = div. 3 chongniu, 4 = div. 4 chongniu, 0 otherwise',
  `rusheng` int(1) DEFAULT NULL COMMENT 'rusheng = 1, ping/shang/qu = 0',
  `baxter_mc` varchar(10) NOT NULL COMMENT 'Baxter 1992',
  `pulley_emc` varchar(10) NOT NULL COMMENT 'Pulleyblank 1984',
  `ipa_zhengzhang` varchar(8) DEFAULT NULL,
  `ipa_pan` varchar(8) DEFAULT NULL,
  `note` varchar(112) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `yj_page` (`yj_page`),
  CONSTRAINT `gy_finals_ibfk_1` FOREIGN KEY (`yj_page`) REFERENCES `yj_pages` (`page`)
) ENGINE=InnoDB AUTO_INCREMENT=164 DEFAULT CHARSET=utf8 COMMENT='GY finals. Data mostly from the RhymeDict project. All components of the syllable besides the initial except tone are considered part of the final. Ping/shang/qusheng are considered the same final, while rusheng is considered distinct.';
